Flooding 



Nadat Joyce haar echtgenoot op wrede wijze is vermoord, weigert ze haar strandhuis te verlaten. Gevangen in haar eigen huis besluit ze nooit meer naar buiten te gaan, ze lijdt onder het verschrikkelijke trauma van het verlies van haar man. Met de hulp van een psycholoog probeert ze het verleden achter zich te laten, tot iets duisters en gewelddadigs haar huis begint binnen te dringen..

